// Home.js

import React from "react";
import { Outlet, Link } from "react-router-dom";
import { IoHome } from "react-icons/io5";
import './Home.css';

const Home = () => {
    return (
        <>
            <header className="navbar">
                <nav>
                    <Link className="navbar-item" to="/Home" title="Home">
                        <img src="1.png" alt="Home" />
                        Home
                    </Link>
                    <Link className="navbar-item" to="/StudentLogin" title="StudentLogin">Student</Link>
                    <div className="navbar-item dropdown">
                        <label className="dropbtn">Landlord</label>
                        <div className="dropdown-content">
                            <Link to="/LandlordLogin">Login</Link>
                            <Link to="/LandlordSignup">Signup</Link>
                        </div>
                    </div>
                    <Link className="navbar-item" to="/WardenLogin" title="WardenLogin">Warden</Link>
                    <Link className="navbar-item" to="/AdminLogin" title="AdminLogin">Admin</Link>
                </nav>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
